import React from 'react';
import Box from '@mui/material/Box';

class ResultsWindow {
  render() {
    return (
      <Box
        sx={{ flexGrow: 1, bgcolor: 'background.paper', display: 'flex'}}
      >
        <div id="resultsWindow" className="modal bd-example-modal-lg">
          <div className="modal-dialog modal-lg">
            <div id="calcResults" className="modal-content">
              <div className="modal-header">
                <div className="loader">
                  <h5 className="modal-title" id="exampleModalLabel"> Calculation Results</h5>
                </div>
              </div>
            </div>
          </div>
        </div>
      </Box>
    )
  }
}

export default ResultsWindow;
